    false,nt"url": null,nt"notes": "This annual narrative report for Midway
    Atoll NWR outlines Refuge accomplishments during the 1992 calendar year. The report
    begins with a summary of the year's highlights and weather conditions. The report
    includes a planning section which discusses compliance with environmental and cultural
    resource mandates and research and investigations. Refuge administration is outlined;
    information about personnel, manpower programs, volunteer programs, funding, safety,
    and technical assistance is given. Habitat management is also covered; subjects
    include forests, grasslands, pest control, contaminants, and wildlife hazards. The
    wildlife section of the report discusses wildlife diversity, endangered and threatened
    species, waterfowl, raptors, marine mammals, fisheries resources, scientific collections,
    animal control, and marking and banding. The public uses of the Refuge described
    in this report include interpretive programs, hunting, fishing, trapping, wildlife
    observation, outdoor recreation, and law enforcement. The equipment and facilities
    section of the report provides information about communication systems and computer
    systems. Cooperative programs are provided at the end.",nt"license_title":
